import React from "react";
import CrecheSlider from "./CrecheSlider";
import plusbutton from "../assets/Plus.svg";



const GstCreches = () => { 
    return (   
       
        <div className="max-w-[800px] mt-[5] w-full h-screen mx-auto text-center flex flex-col justify-center text-[#0B0C38]">
             
              <h1 className=" md:text-7xl sm:text-6xl text-4xl font-bold md:py-6 font-concert ">
              Gestion des Creches
              </h1>
             
                <CrecheSlider/>

               
              
                <p className="md:text-2xl text-xl font-bold text-[#5B112B]"> Vous pouvez ajoutez une creche en appuyant sur ce button : </p>
            <button className="bg-[#FB9B90] w-[160px] rounded-md font-bold my-6 mx-auto py-6 text-[#191A43] border-5  border-[#ED6361] hover:scale-110 duration-300">  
            <img className="w-20 mx-auto mt-[-3rem]" src={plusbutton} alt="/" />
            </button>
              
             
        </div>
    
    )
}

export default GstCreches;
